import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css'; // For custom styles

// Import Pages (we will create these)
// import HomePage from './pages/HomePage';
// import LoginPage from './pages/LoginPage';
// import RegisterPage from './pages/RegisterPage';
// import UserDashboard from './pages/UserDashboard';
// import ErrandTrackerPage from './pages/ErrandTrackerPage';
// import ErrandersDashboard from './pages/ErrandersDashboard';

function App() {
  return (
    // <AuthProvider> We will wrap this in a context provider later
      <Router>
        {/* <Navbar /> We will add a navigation bar component */}
        <div className="container mt-4">
            <Routes>
                {/* <Route path="/" element={<HomePage />} /> */}
                {/* <Route path="/login" element={<LoginPage />} /> */}
                {/* <Route path="/register" element={<RegisterPage />} /> */}
                {/* <Route path="/dashboard" element={<UserDashboard />} /> */}
                {/* <Route path="/errander-dashboard" element={<ErrandersDashboard />} /> */}
                {/* <Route path="/track/:taskId" element={<ErrandTrackerPage />} /> */}
                
                {/* Placeholder route */}
                <Route path="/" element={
                    <div>
                        <h1>Welcome to the Errand App</h1>
                        <p>Project setup is complete. Next steps: build out components and pages.</p>
                    </div>
                } />
            </Routes>
        </div>
      </Router>
    // </AuthProvider>
  );
}

export default App;
